import React from 'react';
import './Cards.css';
import CardItem from './CardItem';
import karachi from '../images/karachi.jpeg';
import lahore from '../images/lahore.jpeg';
import islamabad from '../images/islamabad.jpeg';
import peshawar from '../images/peshawar.jpeg';
import quetta from '../images/quetta.jpeg';


function Cards() {
  return (
    <div className='cards'>
      <div className='cards__container'>
        <div className='cards__wrapper'>
          <ul className='cards__items'>
            <CardItem
              src={karachi}
              text='The City of Lights.'
              label='Karachi'
            />
            <CardItem
              src={lahore}
              text='A scenic and serene rose garden presenting all different colors of roses.'
              label='Rose Garden'
            />
          </ul>
          <ul className='cards__items'>
            <CardItem
              src={islamabad}
              text='Top notch High School in your vicinity.'
              label='High School'
            />
            <CardItem
              src={peshawar}
              text='A deluxe shopping plaza.'
              label='Shopping Mall'
            />
            <CardItem
              src={quetta}
              text='Park for an evening walk and picnic with your family.'
              label='Central Park'
            />
          </ul>
        </div>
      </div>
    </div>
  );
}

export default Cards;
